    return (
        <div>
            <Nav>
                <NavbarContainer>
                    <NavLogo to='/'>
                        SNOUSSI Consulting.
                    </NavLogo>
                    <h1>hey!</h1>

                </NavbarContainer>
            </Nav>

        </div>
    )
}

export default Navbar;
